# List of mayors of Kingston, Jamaica

On 15 March 1801, royal assent was given for establishing the city and parish of Kingston, Jamaica as a corporation, with a mayor, aldermen, and council (Geo. III c. 29 p.&nbsp;144). The first election took place November 15, 1802. Below is a list of mayors of Kingston since 1802:
* John Jaques (1802–1809)
* George Kinghorne (1809–1823)
* Joseph Barnes (1823–1829)
